import React, { useState, useEffect } from 'react';
import "./navbar.css";
import playbttn from './icon/play-button.png';
import io from './icon/control-center.png';
import siri from './icon/siri.png';
import Dock from './Dock';
import Clock from './Clock';

export default function Navbar() {
  const [dropdownApple, setDropdownApple] = useState(false);
  const [dropdownFinder, setDropdownFinder] = useState(false);
  const [dropdownFile, setDropdownFile] = useState(false);
  const [dropdownEdit, setDropdownEdit] = useState(false);
  const [dropdownView, setDropdownView] = useState(false);
  const [dropdownGo, setDropdownGo] = useState(false);
  const [dropdownWindow, setDropdownWindow] = useState(false);
  const [dropdownHelp, setDropdownHelp] = useState(false);
  const [batteryLevel, setBatteryLevel] = useState(null);
  const [isCharging, setIsCharging] = useState(null);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const toggleApple = () => {
    setDropdownApple(!dropdownApple);
    closeAllDropdowns();
  };

  const toggleFinder = () => {
    setDropdownFinder(!dropdownFinder);
    closeAllDropdowns();
  };

  const toggleFile = () => {
    setDropdownFile(!dropdownFile);
    closeAllDropdowns();
  };

  const toggleEdit = () => {
    setDropdownEdit(!dropdownEdit);
    closeAllDropdowns();
  };

  const toggleView = () => {
    setDropdownView(!dropdownView);
    closeAllDropdowns();
  };

  const toggleGo = () => {
    setDropdownGo(!dropdownGo);
    closeAllDropdowns();
  };

  const toggleWindow = () => {
    setDropdownWindow(!dropdownWindow);
    closeAllDropdowns();
  };

  const toggleHelp = () => {
    setDropdownHelp(!dropdownHelp);
    closeAllDropdowns();
  };

  const togglebattery = () => {
    setIsDropdownOpen(!isDropdownOpen);
    closeAllDropdowns();
  };

  const closeAllDropdowns = () => {
    setDropdownApple(false);
    setDropdownFinder(false);
    setDropdownFile(false);
    setDropdownEdit(false);
    setDropdownView(false);
    setDropdownGo(false);
    setDropdownWindow(false);
    setDropdownHelp(false);
    setIsDropdownOpen(false);
  };

  useEffect(() => {
    if ('getBattery' in navigator) {
      navigator.getBattery().then(function (battery) {
        updateBatteryStatus(battery);

        battery.addEventListener('levelchange', () => {
          updateBatteryStatus(battery);
        });

        battery.addEventListener('chargingchange', () => {
          updateBatteryStatus(battery);
        });
      });

      const intervalId = setInterval(() => {
        navigator.getBattery().then(function (battery) {
          updateBatteryStatus(battery);
        });
      }, 1000);
      return () => {
        clearInterval(intervalId);
      };
    } else {
      console.log('Battery API not supported in this browser.');
    }
  }, []);

  const updateBatteryStatus = (battery) => {
    const level = battery.level * 100;
    setBatteryLevel(level);

    const charging = battery.charging;
    setIsCharging(charging);
  };

  const renderBatteryLogo = () => {
    const batteryWidth = `${batteryLevel}%`;
    const batteryColor = 'white';
    const chargingSymbol = isCharging ? (
      <i className="fa fa-bolt" style={{ fontSize: '18px', WebkitTextStroke: '1px #ffffff' }}></i>
    ) : null;

    return (
      <div className="battery-logo-container">
        <div className="battery-logo" style={{ width: batteryWidth, backgroundColor: batteryColor }}></div>
        {chargingSymbol}
      </div>
    );
  };

  return (
    <div className="navbar-container">
      <div className="navbar-left">
        <div className="navbar-button" onClick={toggleApple}>
          <img src={io} alt="Apple Logo" className="navbar-logo" />
          {dropdownApple && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">About This Mac</div>
              <div className="dropdown-item">System Preferences</div>
              <div className="dropdown-item">App Store</div>
              <div className="dropdown-item">Recent Items</div>
              <div className="dropdown-item">Force Quit</div>
              <div className="dropdown-item">Sleep</div>
              <div className="dropdown-item">Restart</div>
              <div className="dropdown-item">Shut Down</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleFinder}>
          <img src={playbttn} alt="Finder Logo" className="navbar-logo" />
          {dropdownFinder && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">About Finder</div>
              <div className="dropdown-item">Preferences</div>
              <div className="dropdown-item">Secure Empty Trash</div>
              <div className="dropdown-item">Services</div>
              <div className="dropdown-item">Hide Finder</div>
              <div className="dropdown-item">Hide Others</div>
              <div className="dropdown-item">Show All</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleFile}>
          <div className="navbar-button-text">File</div>
          {dropdownFile && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">New Window</div>
              <div className="dropdown-item">New Folder</div>
              <div className="dropdown-item">New Finder Window</div>
              <div className="dropdown-item">Open</div>
              <div className="dropdown-item">Close</div>
              <div className="dropdown-item">Save</div>
              <div className="dropdown-item">Save As</div>
              <div className="dropdown-item">Rename</div>
              <div className="dropdown-item">Move</div>
              <div className="dropdown-item">Duplicate</div>
              <div className="dropdown-item">Get Info</div>
              <div className="dropdown-item">Print</div>
              <div className="dropdown-item">Share</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleEdit}>
          <div className="navbar-button-text">Edit</div>
          {dropdownEdit && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">Undo</div>
              <div className="dropdown-item">Redo</div>
              <div className="dropdown-item">Cut</div>
              <div className="dropdown-item">Copy</div>
              <div className="dropdown-item">Paste</div>
              <div className="dropdown-item">Select All</div>
              <div className="dropdown-item">Delete</div>
              <div className="dropdown-item">Find</div>
              <div className="dropdown-item">Replace</div>
              <div className="dropdown-item">Spelling and Grammar</div>
              <div className="dropdown-item">Speech</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleView}>
          <div className="navbar-button-text">View</div>
          {dropdownView && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">as Icons</div>
              <div className="dropdown-item">as List</div>
              <div className="dropdown-item">Show Sidebar</div>
              <div className="dropdown-item">Hide Sidebar</div>
              <div className="dropdown-item">Show Preview</div>
              <div className="dropdown-item">Hide Preview</div>
              <div className="dropdown-item">Show Path Bar</div>
              <div className="dropdown-item">Hide Path Bar</div>
              <div className="dropdown-item">Show Status Bar</div>
              <div className="dropdown-item">Hide Status Bar</div>
              <div className="dropdown-item">Show Tab Bar</div>
              <div className="dropdown-item">Hide Tab Bar</div>
              <div className="dropdown-item">Customize Toolbar</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleGo}>
          <div className="navbar-button-text">Go</div>
          {dropdownGo && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">Back</div>
              <div className="dropdown-item">Forward</div>
              <div className="dropdown-item">Enclosing Folder</div>
              <div className="dropdown-item">Home</div>
              <div className="dropdown-item">Computer</div>
              <div className="dropdown-item">Downloads</div>
              <div className="dropdown-item">Documents</div>
              <div className="dropdown-item">Desktop</div>
              <div className="dropdown-item">Network</div>
              <div className="dropdown-item">iCloud Drive</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleWindow}>
          <div className="navbar-button-text">Window</div>
          {dropdownWindow && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">Minimize</div>
              <div className="dropdown-item">Zoom</div>
              <div className="dropdown-item">Cycle Through Windows</div>
              <div className="dropdown-item">Bring All to Front</div>
              <div className="dropdown-item">Show Previous Tab</div>
              <div className="dropdown-item">Show Next Tab</div>
              <div className="dropdown-item">Merge All Windows</div>
              <div className="dropdown-item">Preferences</div>
            </div>
          )}
        </div>
        <div className="navbar-button" onClick={toggleHelp}>
          <div className="navbar-button-text">Help</div>
          {dropdownHelp && (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">Finder Help</div>
              <div className="dropdown-item">Siri</div>
              <div className="dropdown-item">Spotlight</div>
              <div className="dropdown-item">Show Quick Start</div>
              <div className="dropdown-item">Show Welcome Tour</div>
              <div className="dropdown-item">Keyboard Shortcuts</div>
              <div className="dropdown-item">System Information</div>
              <div className="dropdown-item">Report an Issue</div>
            </div>
          )}
        </div>
      </div>
      <div className="navbar-right">
        <div className="navbar-button" onClick={togglebattery}>
          {isDropdownOpen ? (
            <div className="dropdown" onClick={(e) => e.stopPropagation()}>
              <div className="dropdown-item">Battery Level: {batteryLevel}%</div>
              <div className="dropdown-item">{isCharging ? 'Charging' : 'Not Charging'}</div>
            </div>
          ) : (
            renderBatteryLogo()
          )}
        </div>
        <Clock />
        <div className="navbar-button">
          <img src={siri} alt="Siri Logo" className="navbar-logo" />
        </div>
      </div>
      <Dock />
    </div>
  );
}
